    const members = subscriptions.filter((sub)=> sub.movieId === id)

    const member = members.map((mem, index)=> {return (
        <MemberComp  key={index} id={mem.memberId}/>
    )}
    )

    console.log(member)
    return (
    <div>
        <h5>Subscriptions Watched</h5>
        {/* <MembersComp/> */}
        {member}

    </div>
  )
}

export default SubscriptionComp
